import React, { useState, useEffect } from "react";
import LoGo from "../Ramlogo.png";
import Mouth from "../mouth.png";
import { useParams } from "react-router";
import axios from "axios";
import BaseUrl from "../api/BaseUrl";
import ReactLoading from "react-loading";
import Barcode from "react-barcode";
import {
  formatYearMonthDayTime,
  formatDayMonthYearTimeThai,
  currentYearMonthDay,
} from "../utils/utils.js";
import urlencode from "urlencode";
import { nl2br } from 'react-js-nl2br';

function Report() {
  const [header, setHeader] = useState([]);
  const [patient, setPatient] = useState([]);
  const [userinfo, setUserinfo] = useState([]);
  const [paperinfo, setPaperinfo] = useState([]);
  const [transfer, setTransfer] = useState([]);
  const [vsinfo, setVsinfo] = useState([]);
  const [body, setBody] = useState();
  const [table, setTable] = useState("PTSTBL    ");
  const [type, setType] = useState("PTS1      ");
  const [done, setDone] = useState(true);
  const [ocr, setOcr] = useState([]);
  const { ocmnum, chtnum, seq, user } = useParams();
  const nl2br = require('react-nl2br');
  // const [userinfo, setUserinfo] = useState([]);
  const [teststate, setTeststate] = useState([]);
  const [teststate2, setTeststate2] = useState([]);
  const [teststate3, setTeststate3] = useState([]);

  //pre-op summary
  let setData1 = [];
  let setData2 = [];
  let setData090 = [];

  let test1 = [];
  let test2 = [];
  let test3 = [];



  useEffect(() => {
    getPatientInfo();
  }, []);

  const getPatientInfo = async () => {
    const request_Patient_Report = {
      params: {
        dbServiceName: "HSPatientInfo",
        ocmnum: ocmnum,
      },
    };
    await axios
      .get(
        `${BaseUrl.ram_internet_discharge_summary_newborn_patient_DBService_JSON_path}`,
        request_Patient_Report
      )
      .then((response) => {
        const responseData = response.data.result;
        setPatient(response.data.result);
        console.log("patient", responseData);
        getBody1();
        // getUserinfo();
        // getPaperinfo();
      })
      .catch((error) => {
        console.error(error);
      });
  };

  // useEffect(() => {
  //   getBody();
  // }, [header]);

  const getBody1 = async () => {
    let setRequst = [];
    for (let i = 37; i <= 60; i++) {
      const requestBody = {
        params: {
          dbServiceName: "SWPatientForm",
          ocmnum: ocmnum,
          chtnum: chtnum,
          table: "OPTNTBL",
          type: "OPT6",
          topic: "OPT0" + [i],
          seq: seq
        }
      };
      setRequst.push(
        await axios
          .get(
            `${BaseUrl.ram_internet_discharge_summary_newborn_patient_DBService_JSON_path}`,
            requestBody
          )
          .then((response) => {
            test1.push(response.data.result);
          })
          .catch((error) => console.error(error))
      );
    }
    console.log(test1, 'test1');
    setTeststate(test1);

    getBody2();
  }

  const getBody2 = async () => {
    let setRequst = [];
    // const xx3 = [
    //   {
    //     "code": "OPT038001 ",
    //     "textValue": "Test",
    //     "dataType": "RADIO",
    //     "chtnum": " 900003 ",
    //     "require": "",
    //     "title": "G.A.",
    //     "type": "OPT6 ",
    //     "codeValue": "Y",
    //     "datetime": "202301261333",
    //     "topic": "OPT090 ",
    //     "formNum": "2650",
    //     "ocmnum": " 13472689",
    //     "user": "W32 ",
    //     "seq": "107702",
    //     "table": "OPTNTBL "
    //   },
    //   {
    //     "code": "OPT038002 ",
    //     "textValue": "ahhh",
    //     "dataType": "RADIO",
    //     "chtnum": " 900003 ",
    //     "require": "",
    //     "title": "R.A.",
    //     "type": "OPT6 ",
    //     "codeValue": "Y",
    //     "datetime": "202301261310",
    //     "topic": "OPT090 ",
    //     "formNum": "2650",
    //     "ocmnum": " 13472689",
    //     "user": "W32 ",
    //     "seq": "107610",
    //     "table": "OPTNTBL "
    //   },
    //   {
    //     "code": "OPT038003 ",
    //     "textValue": "Test",
    //     "dataType": "RADIO",
    //     "chtnum": " 900003 ",
    //     "require": "",
    //     "title": "MAC Problem",
    //     "type": "OPT6 ",
    //     "codeValue": "Y",
    //     "datetime": "202301261334",
    //     "topic": "OPT090 ",
    //     "formNum": "2650",
    //     "ocmnum": " 13472689",
    //     "user": "W32 ",
    //     "seq": "107691",
    //     "table": "OPTNTBL "
    //   },
    //   {
    //     "code": "OPT038005 ",
    //     "textValue": "Test",
    //     "dataType": "TEXT",
    //     "chtnum": " 900003 ",
    //     "require": "",
    //     "title": "Previous Medication",
    //     "type": "OPT6 ",
    //     "codeValue": "",
    //     "datetime": "202301261331",
    //     "topic": "OPT090 ",
    //     "formNum": "2650",
    //     "ocmnum": " 13472689",
    //     "user": "W32 ",
    //     "seq": "107692",
    //     "table": "OPTNTBL "
    //   },
    //   {
    //     "code": "OPT038006 ",
    //     "textValue": "Test",
    //     "dataType": "TEXT",
    //     "chtnum": " 900003 ",
    //     "require": "",
    //     "title": "Family Hx",
    //     "type": "OPT6 ",
    //     "codeValue": "",
    //     "datetime": "202301261331",
    //     "topic": "OPT090 ",
    //     "formNum": "2650",
    //     "ocmnum": " 13472689",
    //     "user": "W32 ",
    //     "seq": "107693",
    //     "table": "OPTNTBL "
    //   },
    //   {
    //     "code": "OPT038007 ",
    //     "textValue": "",
    //     "dataType": "RADIO",
    //     "chtnum": " 900003 ",
    //     "require": "",
    //     "title": "Alcohol",
    //     "type": "OPT6 ",
    //     "codeValue": "Y",
    //     "datetime": "202301261333",
    //     "topic": "OPT090 ",
    //     "formNum": "2650",
    //     "ocmnum": " 13472689",
    //     "user": "W32 ",
    //     "seq": "107703",
    //     "table": "OPTNTBL "
    //   },
    //   {
    //     "code": "OPT038008 ",
    //     "textValue": "",
    //     "dataType": "RADIO",
    //     "chtnum": " 900003 ",
    //     "require": "",
    //     "title": "Smoking",
    //     "type": "OPT6 ",
    //     "codeValue": "Y",
    //     "datetime": "202301261331",
    //     "topic": "OPT090 ",
    //     "formNum": "2650",
    //     "ocmnum": " 13472689",
    //     "user": "W32 ",
    //     "seq": "107694",
